import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home-content">
      <p>
        <span className="highlight">Welcome to Talent Tracker</span>, a platform to track and manage talented individuals.
        With our innovative tools and user-friendly interface, you can efficiently discover and connect with talented individuals
        across various industries. Whether you are a recruiter looking for top talents or an individual seeking new opportunities,
        Talent Tracker has got you covered. <span className="emphasis">Join us today</span> and unlock the potential of talent tracking!
      </p>
    </div>
  );
};

export default HomePage;
